import React from 'react';

const HeaderTop = () => {
    return (
        <div className="header-top">
            <ul>
                <li>Sản phẩm yêu thích</li>
                <li>Đăn</li>
                <li></li>
                <li></li>
            </ul>
        </div>
    );
};

export default HeaderTop;
